import React, { Component } from "react";
import withStyles from "@material-ui/core/styles/withStyles";
import SideNav from "../Components/covid/SideNav";
import Covid from "../Components/covid/Covid";
import Symptoms from "../Components/covid/Symptoms";
import Prevention from "../Components/covid/Prevention";
import Testing from "../Components/covid/Testing";
import TestedPositive from "../Components/covid/TestedPositive";
import Inquiries from "../Components/covid/Inquiries";
import Grid from "@material-ui/core/Grid";

// material ui style
const styles = () => ({
  container: {
    marginRight: 30,
    marginLeft: 30,
  },
  bg: {
    backgroundColor: "#000",
  },
});

class covid extends Component {
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.container} style={classes.bg}>
        <Grid container spacing={0}>
          <Grid item xs={0} md={2}>
            <SideNav />
          </Grid>
          <Grid item xs={12} md={10}>
            <Covid />

            <Symptoms />
            <Prevention />
            <Testing />
            <TestedPositive />
            <Inquiries />
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default withStyles(styles)(covid);
